// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

import "./Project.sol";

// AL Contract Interfaces
interface IALProjectVoting {
    function startBatchVoting(string[] memory sampleIds, uint256 round, string[] memory sampleDataHashes) external;
    function endBatchVoting(uint256 round) external;
    function setVoters(address[] memory _voters, uint256[] memory _weights) external;
    function submitBatchVoteOnBehalf(string[] memory sampleIds, string[] memory labels, address voter) external;
    function computeEligibleVoters(address[] memory participants, string[] memory roles, uint256[] memory weights) external pure returns (address[] memory voters, uint256[] memory eligibleWeights);
    function computeBatchProgress(uint256 round, string[] memory sampleIds, bool[] memory sampleActiveStates) external pure returns (uint256 _round, uint256 totalSamples, uint256 activeSamplesCount, uint256 completedSamples, string[] memory _sampleIds, bool batchActive);
    function computeActiveBatch(string[] memory allSampleIds, bool[] memory sampleActiveStates, string[] memory labelSpace, uint256 votingTimeout, uint256 _currentRound) external view returns (string[] memory activeSampleIds, string[] memory sampleData, string[] memory labelOptions, uint256 timeRemaining, uint256 round);
    function projectContract() external view returns (address);
    function getVotingSession(string memory sampleId) external view returns (
        uint256 startTime,
        bool isActive,
        bool isFinalized,
        string memory finalLabel
    );
    function getFinalLabel(string memory sampleId) external view returns (string memory);
    function isVotingActive(string memory sampleId) external view returns (bool);
    function voterWeights(address voter) external view returns (uint256);
}

interface IALProjectStorage {
    function storeFinalLabel(
        string memory sampleId,
        string memory label,
        uint256 round
    ) external;
    function getLabel(string memory sampleId) external view returns (string memory);
    function projectContract() external view returns (address);
    function getFinalLabel(string memory sampleId) external view returns (
        string memory label,
        uint256 round,
        uint256 timestamp
    );
}

contract ALProject is Project {
    // AL-specific metadata
    string public queryStrategy;
    string public alScenario;
    uint256 public maxIteration;
    uint256 public queryBatchSize;
    string[] public labelSpace;

    // DAL-specific state
    uint256 public votingTimeout = 3600; // 1 hour default voting timeout
    string[] private currentBatchSampleIds;
    mapping(string => bool) private activeSamples;

    // Linked AL contracts
    address public votingContract;
    address public storageContract;

    // Round tracking
    uint256 public currentRound;

    // AL Project end conditions tracking
    bool public unlabeledSamplesExhausted = false;

    // AL Project Events
    event ALContractsDeployed(address votingContract, address storageContract);
    event RoundIncremented(uint256 newRound);
    event ALRoundTriggered(uint256 round, string reason, uint256 timestamp);
    event AutoLabelStored(string sampleId, string label, uint256 round, uint256 timestamp);
    event ALBatchStarted(uint256 round, uint256 sampleCount, uint256 timestamp);
    event ALBatchCompleted(uint256 round, uint256 completedSamples, uint256 timestamp);
    event VotersUpdated(uint256 round, uint256 voterCount, uint256 timestamp);
    event VotingSessionStarted(string sampleId, uint256 round, uint256 timeout, uint256 timestamp);
    event VotingSessionEnded(string sampleId, string finalLabel, uint256 round, uint256 timestamp);
    event VoteSubmitted(string sampleId, address voter, string label, uint256 timestamp);
    event ProjectEndTriggered(address indexed trigger, string reason, uint256 currentRound, uint256 timestamp);

    // AL-specific modifiers
    modifier onlyVotingContract() {
        require(msg.sender == votingContract, "Only voting contract can call");
        _;
    }

    // Constructor - calls parent constructor
    constructor(address _creator, string memory _projectData) 
        Project(_creator, _projectData) 
    {
        // AL-specific initialization can go here if needed
    }

    /**
     * @dev Primary function to set up AL project in a single transaction
     * Replaces the removed individual functions: linkALContracts + setALMetadata + updateROCrateHash
     * This is now the only way to configure AL projects, reducing deployment from 5 to 3 transactions
     */
    function setupALProject(
        address _votingContract,
        address _storageContract,
        string memory _queryStrategy,
        string memory _alScenario,
        uint256 _maxIteration,
        uint256 _queryBatchSize,
        string[] memory _labelSpace,
        string memory _rocrateHash
    ) external onlyCreator {
        // Validate inputs
        require(_votingContract != address(0) && _storageContract != address(0), "Invalid contract addresses");
        require(votingContract == address(0), "AL contracts already linked");
        require(storageContract == address(0), "AL contracts already linked");
        require(_maxIteration > 0, "Invalid max iteration");
        require(_queryBatchSize > 0, "Invalid batch size");
        require(bytes(_rocrateHash).length > 0, "RO-Crate hash cannot be empty");

        // 1. Link AL contracts (from linkALContracts)
        votingContract = _votingContract;
        storageContract = _storageContract;

        // Set initial voters in voting contract
        _updateVotersInContract();

        // 2. Set AL metadata (from setALMetadata)
        queryStrategy = _queryStrategy;
        alScenario = _alScenario;
        maxIteration = _maxIteration;
        queryBatchSize = _queryBatchSize;
        labelSpace = _labelSpace;

        // 3. Update RO-Crate hash (from updateROCrateHash)
        this.updateROCrateHash(_rocrateHash);

        // Emit events
        emit ALContractsDeployed(_votingContract, _storageContract);
    }

    /**
     * @dev Get current batch sample IDs
     */
    function getCurrentBatchSampleIds() external view returns (string[] memory) {
        return currentBatchSampleIds;
    }

    /**
     * @dev Check if a sample is currently active for voting
     */
    function isSampleActive(string memory sampleId) external view returns (bool) {
        return activeSamples[sampleId];
    }

    /**
     * @dev Get project AL configuration
     */
    function getALConfiguration() external view returns (
        string memory _queryStrategy,
        string memory _alScenario,
        uint256 _maxIteration,
        uint256 _currentRound,
        uint256 _queryBatchSize,
        uint256 _votingTimeout,
        string[] memory _labelSpace
    ) {
        return (
            queryStrategy,
            alScenario,
            maxIteration,
            currentRound,
            queryBatchSize,
            votingTimeout,
            labelSpace
        );
    }

    /**
     * @dev Helper to update voters in voting contract when participant membership changes
     */
    function _updateVotersInContract() internal {
        if (votingContract == address(0)) return; // Skip if not linked yet

        // Get participant data from parent contract
        (address[] memory participantAddresses, string[] memory roles, uint256[] memory weights,) = this.getAllParticipants();

        if (participantAddresses.length == 0) return;

        // Let ALProjectVoting compute eligible voters and set them
        (address[] memory eligibleVoters, uint256[] memory voterWeights) = IALProjectVoting(votingContract).computeEligibleVoters(participantAddresses, roles, weights);

        if (eligibleVoters.length > 0) {
            IALProjectVoting(votingContract).setVoters(eligibleVoters, voterWeights);
        }
    }

    // Override parent's addParticipantWithRole to update AL voters
    function addParticipantWithRole(address _participant, string memory _role, uint256 _weight) public override onlyCreator {
        // Call parent implementation directly since super doesn't work properly here
        require(bytes(_role).length > 0, "Empty role");
        require(bytes(participantRoles[_participant]).length == 0, "Already participant");
        require(_weight > 0, "Weight must be positive");

        participants.push(_participant);
        participantRoles[_participant] = _role;
        participantWeights[_participant] = _weight;
        joinedAt[_participant] = block.timestamp;

        emit ParticipantAutoAdded(_participant, _role, _weight);
        _updateVotersInContract();
    }

    // Override parent's updateParticipant to update AL voters
    function updateParticipant(address _participant, string memory _role, uint256 _weight) public override onlyCreator {
        // Call parent implementation directly since super doesn't work properly here
        require(bytes(participantRoles[_participant]).length > 0, "Not a participant");
        require(bytes(_role).length > 0, "Empty role");
        require(_weight > 0, "Weight must be positive");

        participantRoles[_participant] = _role;
        participantWeights[_participant] = _weight;
        lastModified = block.timestamp;

        emit ParticipantUpdated(_participant, _role, _weight);
        _updateVotersInContract();
    }

    // Override parent's deactivateProject to emit AL-specific event
    function deactivateProject() public override onlyCreator {
        // Call parent implementation directly
        require(isActive, "Already inactive");
        isActive = false;
        lastModified = block.timestamp;
        emit ProjectDeactivated(msg.sender, block.timestamp);

        // Add AL-specific event
        emit ProjectEndTriggered(msg.sender, "Project manually ended by coordinator", currentRound, block.timestamp);
    }

    // --- Project End Guards ---
    /**
     * @dev Internal function to check if project should end and emit event if so
     */
    function _checkProjectEndConditions() internal {
        if (!isActive) return; // Already ended

        // Check condition 1: Max iteration reached
        if (maxIteration > 0 && currentRound >= maxIteration) {
            emit ProjectEndTriggered(msg.sender, "Maximum iterations reached", currentRound, block.timestamp);
            return;
        }

        // Check condition 2: Unlabeled samples exhausted
        if (unlabeledSamplesExhausted) {
            emit ProjectEndTriggered(msg.sender, "No more unlabeled samples available", currentRound, block.timestamp);
            return;
        }
    }

    /**
     * @dev External function for AL-Engine or coordinator to notify when unlabeled samples are exhausted
     */
    function notifyUnlabeledSamplesExhausted() external onlyCreator {
        require(!unlabeledSamplesExhausted, "Already marked as exhausted");
        unlabeledSamplesExhausted = true;
        _checkProjectEndConditions();
    }

    // --- Round Tracking ---
    function incrementRound() external {
        require(msg.sender == votingContract, "Only voting");
        _incrementRoundInternal(false, "");
    }

    function triggerNextRound(string memory reason) external onlyCreator onlyActive {
        _incrementRoundInternal(true, reason);
    }

    function _incrementRoundInternal(bool isManualTrigger, string memory reason) internal {
        currentRound += 1;

        if (isManualTrigger) {
            lastModified = block.timestamp;
            emit ALRoundTriggered(currentRound, reason, block.timestamp);
        }

        emit RoundIncremented(currentRound);
        _checkProjectEndConditions();
    }

    // --- Voting Management ---
    /**
     * @dev Start batch voting for AL iteration samples
     * Always use this method (even for single samples) for consistent event handling
     * Voters are automatically managed when project membership changes
     */
    function startBatchVoting(string[] memory sampleIds, string[] memory sampleDataHashes) external onlyCreator {
        require(votingContract != address(0), "Voting contract not set");
        require(sampleIds.length > 0, "Empty sample batch");

        // Increment round for new batch
        currentRound += 1;

        // Check if project should end due to max iterations or sample exhaustion
        _checkProjectEndConditions();

        // Start the batch voting session (voters already set from membership)
        IALProjectVoting(votingContract).startBatchVoting(sampleIds, currentRound, sampleDataHashes);

        emit ALBatchStarted(currentRound, sampleIds.length, block.timestamp);
    }

    function endBatchVoting(uint256 round) external onlyCreator {
        require(votingContract != address(0), "Voting contract not set");
        require(round == currentRound, "Invalid round");

        // Forward to ALProjectVoting which will handle finalization and completion
        IALProjectVoting(votingContract).endBatchVoting(round);

        // Note: ALProjectVoting will automatically:
        // 1. Finalize remaining active samples
        // 2. Call _checkBatchCompletion  
        // 3. Emit BatchCompleted event
        // 4. Call notifyVotingSessionEnded for each sample (which clears activeSamples)
    }

    function storeFinalLabel(
        string memory sampleId,
        string memory label,
        uint256 round
    ) external onlyCreator {
        require(storageContract != address(0), "Storage contract not set");

        // Call via interface
        IALProjectStorage(storageContract).storeFinalLabel(sampleId, label, round);
    }

    /**
     * @dev Automatically receives and stores finalized labels from the voting contract
     * This function is called automatically when voting sessions are finalized
     */
    function receiveFinalLabelFromVoting(
        string memory sampleId,
        string memory label
    ) external onlyVotingContract {
        require(storageContract != address(0), "Storage contract not set");

        // Store the finalized label using current round
        IALProjectStorage(storageContract).storeFinalLabel(
            sampleId, 
            label, 
            currentRound
        );

        // Emit event for tracking automatic label storage
        emit AutoLabelStored(sampleId, label, currentRound, block.timestamp);
    }

    // ==================== DAL LABELING METHODS ====================

    /**
     * @dev Submit votes for multiple samples (batch voting only)
     * Auto-adds users as project members if needed
     */
    function submitBatchVote(string[] memory sampleIds, string[] memory labels) external {
        require(votingContract != address(0), "Voting contract not set");
        require(sampleIds.length == labels.length, "Mismatched arrays");
        require(sampleIds.length > 0, "Empty batch");

        // Verify all samples are active for voting
        for (uint256 i = 0; i < sampleIds.length; i++) {
            require(activeSamples[sampleIds[i]], "Sample not active for voting");
            require(bytes(sampleIds[i]).length > 0, "Empty sample ID");
            require(bytes(labels[i]).length > 0, "Empty label");
        }

        // Auto-add user as project participant if needed
        if (bytes(this.getParticipantRole(msg.sender)).length == 0) {
            addParticipantWithRole(msg.sender, "contributor", 1);
            // Note: addParticipantWithRole automatically updates voters in voting contract
        }

        // Verify user is eligible to vote
        require(bytes(this.getParticipantRole(msg.sender)).length > 0, "Not a project participant");

        // Check if user is registered in voting contract
        uint256 voterWeight = IALProjectVoting(votingContract).voterWeights(msg.sender);
        require(voterWeight > 0, "Voter not registered in voting contract");

        // Emit events for each vote
        for (uint256 i = 0; i < sampleIds.length; i++) {
            emit VoteSubmitted(sampleIds[i], msg.sender, labels[i], block.timestamp);
        }

        // Forward batch vote to ALProjectVoting contract
        IALProjectVoting(votingContract).submitBatchVoteOnBehalf(sampleIds, labels, msg.sender);
    }

    /**
     * @dev Called by ALProjectVoting when a voting session starts
     * This enables DAL event emission
     */
    function notifyVotingSessionStarted(string memory sampleId) external onlyVotingContract {
        activeSamples[sampleId] = true;

        // Add to current batch if not already present
        bool found = false;
        for (uint i = 0; i < currentBatchSampleIds.length; i++) {
            if (keccak256(bytes(currentBatchSampleIds[i])) == keccak256(bytes(sampleId))) {
                found = true;
                break;
            }
        }
        if (!found) {
            currentBatchSampleIds.push(sampleId);
        }

        emit VotingSessionStarted(sampleId, currentRound, votingTimeout, block.timestamp);
    }

    /**
     * @dev Called by ALProjectVoting when a voting session ends
     * This enables DAL event emission
     */
    function notifyVotingSessionEnded(string memory sampleId, string memory finalLabel) external onlyVotingContract {
        activeSamples[sampleId] = false;
        emit VotingSessionEnded(sampleId, finalLabel, currentRound, block.timestamp);

        // Check if all samples in current batch are completed
        bool allCompleted = true;
        uint256 completedCount = 0;

        for (uint i = 0; i < currentBatchSampleIds.length; i++) {
            if (activeSamples[currentBatchSampleIds[i]]) {
                allCompleted = false;
            } else {
                completedCount++;
            }
        }

        if (allCompleted && currentBatchSampleIds.length > 0) {
            emit ALBatchCompleted(currentRound, completedCount, block.timestamp);

            // Clear the batch after all samples are completed
            delete currentBatchSampleIds;
        }
    }

    function hasALContracts() external view returns (bool) {
        return votingContract != address(0) && storageContract != address(0);
    }

    function needsALDeployment() external view returns (bool) {
        // Check if this is an AL project that needs AL contracts
        if (this.hasALContracts()) {
            return false; // Already has AL contracts
        }

        // Check projectType field - this is the primary and efficient method
        return keccak256(bytes(projectType)) == keccak256(bytes("active_learning"));
    }

    /**
     * @dev Check if project should end based on any of the three conditions
     * Returns (shouldEnd, reason)
     */
    function shouldProjectEnd() external view returns (bool shouldEnd, string memory reason) {
        if (!isActive) {
            return (true, "Project manually deactivated");
        }

        // Condition 1: Max iteration reached
        if (maxIteration > 0 && currentRound >= maxIteration) {
            return (true, "Maximum iterations reached");
        }

        // Condition 2: Unlabeled samples exhausted
        if (unlabeledSamplesExhausted) {
            return (true, "No more unlabeled samples available");
        }

        // Condition 3: Manual end (handled by coordinator through frontend)
        return (false, "Project is still active");
    }

    // AL-specific metadata getter with extended fields
    function getALProjectMetadata() external view returns (
        string memory _title,
        string memory _description,
        address _owner,
        string memory _projectType,
        string memory _rocrateHash,
        uint256 _start,
        uint256 _end,
        string memory _queryStrategy,
        string memory _alScenario,
        uint256 _maxIteration,
        uint256 _queryBatchSize,
        string[] memory _labelSpace
    ) {
        return (
            title,
            description,
            creator,
            projectType,
            rocrateHash,
            startTime,
            endTime,
            queryStrategy,
            alScenario,
            maxIteration,
            queryBatchSize,
            labelSpace
        );
    }
}

contracts/ALProjectStorage.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

contract ALProjectStorage {
    address public project;

    struct FinalLabel {
        string sampleId;
        string label;
        uint256 round;
        uint256 timestamp;
    }

    // sampleId => FinalLabel
    mapping(string => FinalLabel) public finalLabels;

    event LabelFinalized(string sampleId, string label, uint256 round, uint256 timestamp);

    modifier onlyProject() {
        require(msg.sender == project, "Only main project can call");
        _;
    }

    constructor(address _project) {
        require(_project != address(0), "Invalid project address");
        project = _project;
    }

    function storeFinalLabel(
        string memory sampleId,
        string memory label,
        uint256 round
    ) external onlyProject {
        _storeFinalLabelInternal(sampleId, label, round);
    }

    /**
     * @dev Internal function to store final labels
     */
    function _storeFinalLabelInternal(
        string memory sampleId,
        string memory label,
        uint256 round
    ) internal {
        require(bytes(sampleId).length > 0, "Sample ID cannot be empty");
        require(bytes(label).length > 0, "Label cannot be empty");

        FinalLabel memory f = FinalLabel({
            sampleId: sampleId,
            label: label,
            round: round,
            timestamp: block.timestamp
        });

        finalLabels[sampleId] = f;

        emit LabelFinalized(sampleId, label, round, block.timestamp);
    }

    function getFinalLabel(string memory sampleId) external view returns (
        string memory label,
        uint256 round,
        uint256 timestamp
    ) {
        FinalLabel memory f = finalLabels[sampleId];
        return (f.label, f.round, f.timestamp);
    }

    function getLabel(string memory sampleId) external view returns (string memory) {
        return finalLabels[sampleId].label;
    }

    /**
     * @dev Check if a sample already has a final label
     */
    function hasFinalLabel(string memory sampleId) external view returns (bool) {
        return bytes(finalLabels[sampleId].sampleId).length > 0;
    }

    /**
     * @dev Validate sample ID format
     */
    function isValidSampleId(string memory sampleId) external pure returns (bool) {
        return bytes(sampleId).length > 0 && bytes(sampleId).length <= 64;
    }
}

contracts/ALProjectVoting.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

interface IProject {
    function receiveFinalLabelFromVoting(
        string memory sampleId,
        string memory label
    ) external;
    function notifyVotingSessionStarted(string memory sampleId) external;
    function notifyVotingSessionEnded(string memory sampleId, string memory finalLabel) external;
}

contract ALProjectVoting {
    address public project;
    uint256 public consensusThreshold = 51; // percentage
    uint256 public votingTimeoutSeconds;
    string public votingConsensus; // e.g. "simple_majority"

    struct Voter {
        address addr;
        uint256 weight;
    }

    struct Vote {
        address voter;
        string label;
        bool support;
        uint256 timestamp;
    }

    struct VotingSession {
        uint256 startTime;
        bool isActive;
        bool isFinalized;
        string finalLabel;
        uint256 totalVoters;
        uint256 round; // Add round tracking
        mapping(address => bool) hasVoted;
        mapping(string => uint256) labelVotes;
        mapping(string => uint256) labelWeights;
    }

    struct BatchInfo {
        uint256 round;
        string[] sampleIds;
        uint256 completedCount;
        bool isActive;
        uint256 startTime;
        mapping(string => string) sampleDataHashes; // NEW: Map each sampleId to its IPFS hash
    }

    mapping(address => uint256) public voterWeights;
    address[] public voterList;

    // sampleId => list of votes
    mapping(string => Vote[]) public votes;
    mapping(string => VotingSession) public votingSessions;
    // round => BatchInfo
    mapping(uint256 => BatchInfo) public batches;
    // Track current round
    uint256 public currentRound;

    event VoteSubmitted(string sampleId, address indexed voter, string label, bool support, uint256 timestamp);
    event ConsensusReached(string sampleId, string label);
    event VotingSessionStarted(string sampleId, uint256 startTime);
    event VotingSessionEnded(string sampleId, uint256 endTime);
    event VotingSessionFinalized(string sampleId, string finalLabel, uint256 endTime, string reason);
    event TimeoutReached(string sampleId, uint256 endTime);
    event LabelStoredInProject(string sampleId, string finalLabel, uint256 timestamp);
    event BatchStarted(uint256 round, string[] sampleIds, uint256 startTime);
    event BatchCompleted(uint256 round, uint256 completedSamples, uint256 timestamp);
    event BatchSampleCompleted(uint256 round, string sampleId, string finalLabel, uint256 remainingSamples);

    modifier onlyProject() {
        require(msg.sender == project, "Only main project can call");
        _;
    }

    modifier onlyRegisteredVoter() {
        require(voterWeights[msg.sender] > 0, "Not a registered voter");
        _;
    }

    constructor(
        address _project,
        string memory _votingConsensus,
        uint256 _votingTimeoutSeconds
    ) {
        require(_project != address(0), "Invalid address");
        project = _project;
        votingConsensus = _votingConsensus;
        votingTimeoutSeconds = _votingTimeoutSeconds;
    }

    function setVoters(address[] memory _voters, uint256[] memory _weights) external onlyProject {
        require(_voters.length == _weights.length, "Mismatched lengths");

        // Clear existing voters
        for (uint256 i = 0; i < voterList.length; i++) {
            voterWeights[voterList[i]] = 0;
        }
        delete voterList;

        // Add new voters
        for (uint256 i = 0; i < _voters.length; i++) {
            require(_weights[i] > 0, "Weight must be greater than 0");
            voterWeights[_voters[i]] = _weights[i];
            voterList.push(_voters[i]);
        }
    }

    /**
     * @dev Compute eligible voters from participant data (moved from Project.sol)
     */
    function computeEligibleVoters(
        address[] memory participants,
        string[] memory roles,
        uint256[] memory weights
    ) external pure returns (address[] memory voters, uint256[] memory eligibleWeights) {
        require(participants.length == roles.length, "Participants/roles length mismatch");
        require(participants.length == weights.length, "Participants/weights length mismatch");

        // Count eligible voters first
        uint256 eligibleCount = 0;
        for (uint256 i = 0; i < participants.length; i++) {
            if (keccak256(bytes(roles[i])) == keccak256(bytes("creator")) ||
                keccak256(bytes(roles[i])) == keccak256(bytes("contributor")) ||
                keccak256(bytes(roles[i])) == keccak256(bytes("coordinator"))) {
                eligibleCount++;
            }
        }

        // Build arrays of eligible voters
        voters = new address[](eligibleCount);
        eligibleWeights = new uint256[](eligibleCount);
        uint256 index = 0;

        for (uint256 i = 0; i < participants.length; i++) {
            if (keccak256(bytes(roles[i])) == keccak256(bytes("creator")) ||
                keccak256(bytes(roles[i])) == keccak256(bytes("contributor")) ||
                keccak256(bytes(roles[i])) == keccak256(bytes("coordinator"))) {
                voters[index] = participants[i];
                eligibleWeights[index] = weights[i];
                index++;
            }
        }

        return (voters, eligibleWeights);
    }

    function startBatchVoting(string[] memory sampleIds, uint256 round, string[] memory sampleDataHashes) external onlyProject {
        require(sampleIds.length > 0, "Empty sample batch");
        require(sampleIds.length == sampleDataHashes.length, "Sample IDs and hashes length mismatch");
        require(!batches[round].isActive, "Batch already active for this round");

        // Initialize batch
        batches[round].round = round;
        batches[round].sampleIds = sampleIds;
        batches[round].completedCount = 0;
        batches[round].isActive = true;
        batches[round].startTime = block.timestamp;

        // Store individual IPFS hashes for each sample
        for (uint256 i = 0; i < sampleIds.length; i++) {
            batches[round].sampleDataHashes[sampleIds[i]] = sampleDataHashes[i];
        }

        currentRound = round;

        // Start voting sessions for all samples in the batch
        for (uint256 i = 0; i < sampleIds.length; i++) {
            string memory sampleId = sampleIds[i];
            require(!votingSessions[sampleId].isActive, "Sample already has active session");
            require(!votingSessions[sampleId].isFinalized, "Sample already finalized");

            votingSessions[sampleId].startTime = block.timestamp;
            votingSessions[sampleId].isActive = true;
            votingSessions[sampleId].isFinalized = false;
            votingSessions[sampleId].totalVoters = voterList.length;
            votingSessions[sampleId].round = round;

            emit VotingSessionStarted(sampleId, block.timestamp);

            // Notify main contract
            try IProject(project).notifyVotingSessionStarted(sampleId) {
                // Success
            } catch {
                // Continue if notification fails
            }
        }

        emit BatchStarted(round, sampleIds, block.timestamp);
    }

    /**
     * @dev Manually end all active samples in a batch (admin override)
     */
    function endBatchVoting(uint256 round) external onlyProject {
        require(batches[round].isActive, "Batch not active");

        string[] memory sampleIds = batches[round].sampleIds;

        // Finalize all active samples in the batch
        for (uint256 i = 0; i < sampleIds.length; i++) {
            string memory sampleId = sampleIds[i];

            // Only finalize if still active (not already completed)
            if (votingSessions[sampleId].isActive && !votingSessions[sampleId].isFinalized) {
                _finalizeVotingSession(sampleId, "Manual batch ending");
            }
        }

        // Note: _checkBatchCompletion will be called by _finalizeVotingSession for each sample
        // This will automatically mark the batch as complete and emit BatchCompleted
    }

    /**
     * @dev Submit votes for multiple samples in a batch (called by Project contract)
     * This allows Project to forward batch votes after auto-registering users
     * This is now the ONLY way to submit votes - works for batch size 1 or more
     */
    function submitBatchVoteOnBehalf(
        string[] memory sampleIds, 
        string[] memory labels, 
        address voter
    ) external onlyProject {
        require(sampleIds.length == labels.length, "Mismatched arrays");
        require(sampleIds.length > 0, "Empty batch");
        require(voterWeights[voter] > 0, "Voter not registered");

        uint256 currentBatchRound = 0;

        for (uint256 i = 0; i < sampleIds.length; i++) {
            string memory sampleId = sampleIds[i];
            string memory label = labels[i];

            require(votingSessions[sampleId].isActive, "Voting session not active");
            require(!votingSessions[sampleId].isFinalized, "Voting session already finalized");
            require(!votingSessions[sampleId].hasVoted[voter], "Already voted on this sample");

            // Get the round from the first sample
            if (i == 0) {
                currentBatchRound = votingSessions[sampleId].round;
            }

            // Check timeout for each sample
            if (_isTimeoutReached(sampleId)) {
                _finalizeVotingSession(sampleId, "Timeout reached");
                continue; // Skip this sample
            }

            // Record the vote
            votes[sampleId].push(Vote({
                voter: voter,
                label: label,
                support: true,
                timestamp: block.timestamp
            }));

            votingSessions[sampleId].hasVoted[voter] = true;

            // Update vote aggregation
            votingSessions[sampleId].labelVotes[label]++;
            votingSessions[sampleId].labelWeights[label] += voterWeights[voter];

            emit VoteSubmitted(sampleId, voter, label, true, block.timestamp);
        }

        // Check if all voters have completed their batch voting for this round
        if (currentBatchRound > 0 && _allVotersCompletedBatch(currentBatchRound)) {
            // Finalize all samples in the batch
            string[] memory batchSampleIds = batches[currentBatchRound].sampleIds;
            for (uint256 i = 0; i < batchSampleIds.length; i++) {
                string memory sampleId = batchSampleIds[i];
                if (votingSessions[sampleId].isActive && !votingSessions[sampleId].isFinalized) {
                    // Check for consensus first
                    string memory consensusLabel = _checkForConsensus(sampleId);
                    if (bytes(consensusLabel).length > 0) {
                        _finalizeVotingSession(sampleId, "Consensus reached");
                        emit ConsensusReached(sampleId, consensusLabel);
                    } else {
                        _finalizeVotingSession(sampleId, "All voters completed batch");
                    }
                }
            }
        }
    }

    /**
     * @dev Submit votes for multiple samples in a batch (direct user call)
     */
    function submitBatchVote(
        string[] memory sampleIds, 
        string[] memory labels, 
        bool[] memory support
    ) external onlyRegisteredVoter {
        require(sampleIds.length == labels.length, "Mismatched sampleIds and labels");
        require(sampleIds.length == support.length, "Mismatched sampleIds and support");

        for (uint256 i = 0; i < sampleIds.length; i++) {
            string memory sampleId = sampleIds[i];
            string memory label = labels[i];
            bool sampleSupport = support[i];

            require(votingSessions[sampleId].isActive, "Voting session not active");
            require(!votingSessions[sampleId].isFinalized, "Voting session already finalized");
            require(!votingSessions[sampleId].hasVoted[msg.sender], "Already voted on this sample");

            // Check timeout for each sample
            if (_isTimeoutReached(sampleId)) {
                _finalizeVotingSession(sampleId, "Timeout reached");
                continue; // Skip this sample
            }

            // Record the vote
            votes[sampleId].push(Vote({
                voter: msg.sender,
                label: label,
                support: sampleSupport,
                timestamp: block.timestamp
            }));

            votingSessions[sampleId].hasVoted[msg.sender] = true;

            // Update vote aggregation
            if (sampleSupport) {
                votingSessions[sampleId].labelVotes[label]++;
                votingSessions[sampleId].labelWeights[label] += voterWeights[msg.sender];
            }

            emit VoteSubmitted(sampleId, msg.sender, label, sampleSupport, block.timestamp);
        }

        // Check if all voters have completed their batch voting for this round
        // Get the round from the first sample
        if (sampleIds.length > 0) {
            uint256 currentBatchRound = votingSessions[sampleIds[0]].round;

            if (currentBatchRound > 0 && _allVotersCompletedBatch(currentBatchRound)) {
                // Finalize all samples in the batch
                string[] memory batchSampleIds = batches[currentBatchRound].sampleIds;
                for (uint256 i = 0; i < batchSampleIds.length; i++) {
                    string memory sampleId = batchSampleIds[i];
                    if (votingSessions[sampleId].isActive && !votingSessions[sampleId].isFinalized) {
                        // Check for consensus first
                        string memory consensusLabel = _checkForConsensus(sampleId);
                        if (bytes(consensusLabel).length > 0) {
                            _finalizeVotingSession(sampleId, "Consensus reached");
                            emit ConsensusReached(sampleId, consensusLabel);
                        } else {
                            _finalizeVotingSession(sampleId, "All voters completed batch");
                        }
                    }
                }
            }
        }
    }

    function _checkConsensus(string memory sampleId, string memory label) internal view returns (bool) {
        Vote[] memory voteList = votes[sampleId];
        if (voteList.length == 0) return false;

        uint256 labelSupportCount = 0;
        uint256 labelTotalCount = 0;

        // Count votes for this specific label (ignoring weights for now)
        for (uint256 i = 0; i < voteList.length; i++) {
            if (keccak256(bytes(voteList[i].label)) == keccak256(bytes(label))) {
                labelTotalCount++;
                if (voteList[i].support) {
                    labelSupportCount++;
                }

                // Weight-based calculation (commented out for now):
                // uint256 weight = voterWeights[voteList[i].voter];
                // labelTotalWeight += weight;
                // if (voteList[i].support) {
                //     labelSupportWeight += weight;
                // }
            }
        }

        // If no one voted for this label, no consensus
        if (labelTotalCount == 0) return false;

        // Simple vote counting: if ALL voters who chose this label support it, 
        // and this label has majority among all actual votes, that's consensus
        bool allVotersSupportThisLabel = (labelSupportCount == labelTotalCount);

        if (allVotersSupportThisLabel) {
            // Check if this label has majority support among all actual votes
            uint256 totalVotes = voteList.length;
            uint256 labelPercentage = (labelSupportCount * 100) / totalVotes;
            return labelPercentage >= consensusThreshold;
        }

        return false;
    }

    function getVotes(string memory sampleId) external view returns (Vote[] memory) {
        return votes[sampleId];
    }

    function getVoterList() external view returns (Voter[] memory) {
        Voter[] memory result = new Voter[](voterList.length);
        for (uint256 i = 0; i < voterList.length; i++) {
            result[i] = Voter({
                addr: voterList[i],
                weight: voterWeights[voterList[i]]
            });
        }
        return result;
    }

    function isVotingActive(string memory sampleId) external view returns (bool) {
        return votingSessions[sampleId].isActive && !votingSessions[sampleId].isFinalized;
    }

    function hasUserVoted(string memory sampleId, address user) external view returns (bool) {
        return votingSessions[sampleId].hasVoted[user];
    }

    function checkAndFinalizeTimeout(string memory sampleId) external {
        require(votingSessions[sampleId].isActive, "Session not active");
        require(!votingSessions[sampleId].isFinalized, "Already finalized");
        require(_isTimeoutReached(sampleId), "Timeout not reached yet");

        _finalizeVotingSession(sampleId, "Timeout reached - external trigger");
        emit TimeoutReached(sampleId, block.timestamp);
    }

    function isTimeoutReached(string memory sampleId) external view returns (bool) {
        return _isTimeoutReached(sampleId);
    }

    function getFinalLabel(string memory sampleId) external view returns (string memory) {
        return votingSessions[sampleId].finalLabel;
    }

    function getVotingSession(string memory sampleId) external view returns (
        uint256 startTime,
        bool isActive,
        bool isFinalized,
        string memory finalLabel
    ) {
        VotingSession storage session = votingSessions[sampleId];
        return (session.startTime, session.isActive, session.isFinalized, session.finalLabel);
    }

    function getVotingResult(string memory sampleId) external view returns (
        bool isFinalized,
        string memory finalLabel,
        uint256 totalVotes,
        uint256 votedCount
    ) {
        VotingSession storage session = votingSessions[sampleId];

        uint256 voted = 0;
        for (uint256 i = 0; i < voterList.length; i++) {
            if (session.hasVoted[voterList[i]]) {
                voted++;
            }
        }

        return (
            session.isFinalized,
            session.finalLabel,
            votes[sampleId].length,
            voted
        );
    }

    function getVotingDistribution(string memory sampleId) external view returns (
        string[] memory labels,
        uint256[] memory voteCounts,
        uint256[] memory voteWeights
    ) {
        Vote[] memory voteList = votes[sampleId];
        VotingSession storage session = votingSessions[sampleId];

        if (voteList.length == 0) {
            return (new string[](0), new uint256[](0), new uint256[](0));
        }

        // Get unique labels (simplified - in production might want more efficient approach)
        string[] memory tempLabels = new string[](voteList.length);
        uint256 labelCount = 0;

        for (uint256 i = 0; i < voteList.length; i++) {
            string memory currentLabel = voteList[i].label;
            bool exists = false;

            for (uint256 j = 0; j < labelCount; j++) {
                if (keccak256(bytes(tempLabels[j])) == keccak256(bytes(currentLabel))) {
                    exists = true;
                    break;
                }
            }

            if (!exists) {
                tempLabels[labelCount] = currentLabel;
                labelCount++;
            }
        }

        // Create arrays with actual size
        labels = new string[](labelCount);
        voteCounts = new uint256[](labelCount);
        voteWeights = new uint256[](labelCount);

        for (uint256 i = 0; i < labelCount; i++) {
            labels[i] = tempLabels[i];
            voteCounts[i] = session.labelVotes[tempLabels[i]];
            voteWeights[i] = session.labelWeights[tempLabels[i]];
        }

        return (labels, voteCounts, voteWeights);
    }

    function getVotingSessionStatus(string memory sampleId) external view returns (
        bool isActive,
        bool isFinalized,
        string memory finalLabel,
        uint256 startTime,
        uint256 timeRemaining,
        uint256 votedCount,
        uint256 totalVoters
    ) {
        VotingSession storage session = votingSessions[sampleId];

        uint256 remaining = 0;
        if (votingTimeoutSeconds > 0 && session.isActive && !session.isFinalized) {
            uint256 endTime = session.startTime + votingTimeoutSeconds;
            if (block.timestamp < endTime) {
                remaining = endTime - block.timestamp;
            }
        }

        uint256 voted = 0;
        for (uint256 i = 0; i < voterList.length; i++) {
            if (session.hasVoted[voterList[i]]) {
                voted++;
            }
        }

        return (
            session.isActive,
            session.isFinalized,
            session.finalLabel,
            session.startTime,
            remaining,
            voted,
            session.totalVoters
        );
    }

    function _isTimeoutReached(string memory sampleId) internal view returns (bool) {
        if (votingTimeoutSeconds == 0) return false;
        return block.timestamp > votingSessions[sampleId].startTime + votingTimeoutSeconds;
    }

    function _allVotersVoted(string memory sampleId) internal view returns (bool) {
        uint256 votedCount = 0;
        for (uint256 i = 0; i < voterList.length; i++) {
            if (votingSessions[sampleId].hasVoted[voterList[i]]) {
                votedCount++;
            }
        }
        return votedCount == votingSessions[sampleId].totalVoters;
    }

    function _allVotersCompletedBatch(uint256 round) internal view returns (bool) {
        string[] memory sampleIds = batches[round].sampleIds;
        if (sampleIds.length == 0) return false;

        // Check if every voter has voted on every sample in the batch
        for (uint256 voterIndex = 0; voterIndex < voterList.length; voterIndex++) {
            address voter = voterList[voterIndex];

            for (uint256 sampleIndex = 0; sampleIndex < sampleIds.length; sampleIndex++) {
                string memory sampleId = sampleIds[sampleIndex];

                // If this voter hasn't voted on this sample, batch is not complete
                if (!votingSessions[sampleId].hasVoted[voter]) {
                    return false;
                }
            }
        }

        // All voters have voted on all samples in the batch
        return true;
    }

    function _checkForConsensus(string memory sampleId) internal view returns (string memory) {
        Vote[] memory voteList = votes[sampleId];
        if (voteList.length == 0) return "";

        // Get all unique labels
        string[] memory uniqueLabels = new string[](voteList.length);
        uint256 labelCount = 0;

        for (uint256 i = 0; i < voteList.length; i++) {
            string memory currentLabel = voteList[i].label;
            bool exists = false;

            for (uint256 j = 0; j < labelCount; j++) {
                if (keccak256(bytes(uniqueLabels[j])) == keccak256(bytes(currentLabel))) {
                    exists = true;
                    break;
                }
            }

            if (!exists) {
                uniqueLabels[labelCount] = currentLabel;
                labelCount++;
            }
        }

        // Check consensus for each label
        for (uint256 i = 0; i < labelCount; i++) {
            if (_checkConsensus(sampleId, uniqueLabels[i])) {
                return uniqueLabels[i];
            }
        }

        return "";
    }

    function _finalizeVotingSession(string memory sampleId, string memory reason) internal {
        require(votingSessions[sampleId].isActive, "Session not active");
        require(!votingSessions[sampleId].isFinalized, "Already finalized");

        // Mark as finalized
        votingSessions[sampleId].isActive = false;
        votingSessions[sampleId].isFinalized = true;

        // Determine final label through vote aggregation
        string memory finalLabel = _aggregateVotes(sampleId);
        votingSessions[sampleId].finalLabel = finalLabel;

        // Emit events
        emit VotingSessionEnded(sampleId, block.timestamp);
        emit VotingSessionFinalized(sampleId, finalLabel, block.timestamp, reason);

        // Check if this sample is part of a batch
        uint256 sampleRound = votingSessions[sampleId].round;
        if (sampleRound > 0 && batches[sampleRound].isActive) {
            _checkBatchCompletion(sampleRound, sampleId, finalLabel);
        }

        // Notify main contract to store the result
        _notifyMainContract(sampleId, finalLabel);
    }

    function _checkBatchCompletion(uint256 round, string memory completedSampleId, string memory finalLabel) internal {
        batches[round].completedCount++;

        uint256 remaining = batches[round].sampleIds.length - batches[round].completedCount;
        emit BatchSampleCompleted(round, completedSampleId, finalLabel, remaining);

        // Check if batch is complete
        if (batches[round].completedCount >= batches[round].sampleIds.length) {
            batches[round].isActive = false;
            emit BatchCompleted(round, batches[round].completedCount, block.timestamp);
        }
    }

    function getBatchStatus(uint256 round) external view returns (
        bool isActive,
        uint256 totalSamples,
        uint256 completedSamples,
        uint256 remainingSamples,
        uint256 startTime
    ) {
        BatchInfo storage batch = batches[round];
        return (
            batch.isActive,
            batch.sampleIds.length,
            batch.completedCount,
            batch.sampleIds.length - batch.completedCount,
            batch.startTime
        );
    }

    function getBatchSamples(uint256 round) external view returns (string[] memory) {
        return batches[round].sampleIds;
    }

    /**
     * @dev Compute active batch for UI (moved from Project.sol)
     */
    function computeActiveBatch(
        string[] memory allSampleIds,
        bool[] memory sampleActiveStates,
        string[] memory labelSpace,
        uint256 votingTimeout,
        uint256 _currentRound
    ) external view returns (
        string[] memory activeSampleIds,
        string[] memory sampleData, 
        string[] memory labelOptions,
        uint256 timeRemaining,
        uint256 round
    ) {
        require(allSampleIds.length == sampleActiveStates.length, "Length mismatch");

        // Count active samples first
        uint256 activeCount = 0;
        for (uint256 i = 0; i < allSampleIds.length; i++) {
            if (sampleActiveStates[i]) {
                activeCount++;
            }
        }

        if (activeCount == 0) {
            return (new string[](0), new string[](0), new string[](0), 0, _currentRound);
        }

        // Build array of active samples
        activeSampleIds = new string[](activeCount);
        uint256 index = 0;

        for (uint256 i = 0; i < allSampleIds.length; i++) {
            if (sampleActiveStates[i]) {
                activeSampleIds[index] = allSampleIds[i];
                index++;
            }
        }

        // Prepare sample data - use IPFS hash from batch info instead of placeholder
        sampleData = new string[](activeSampleIds.length);

        // Get the IPFS hash for each active sample
        BatchInfo storage currentBatch = batches[_currentRound];

        for (uint256 i = 0; i < activeSampleIds.length; i++) {
            string memory sampleId = activeSampleIds[i];
            string memory ipfsHash = currentBatch.sampleDataHashes[sampleId];

            if (bytes(ipfsHash).length > 0) {
                // Return IPFS hash for frontend to fetch actual sample data
                sampleData[i] = ipfsHash;
            } else {
                // Fallback to placeholder if no IPFS hash available
                sampleData[i] = string(abi.encodePacked("Sample data for ", sampleId));
            }
        }

        // Get time remaining from first sample
        uint256 remaining = 0;
        if (activeSampleIds.length > 0) {
            (uint256 sessionStartTime, bool sessionIsActive, bool isFinalized, ) = 
                this.getVotingSession(activeSampleIds[0]);

            if (sessionIsActive && !isFinalized) {
                uint256 elapsed = block.timestamp - sessionStartTime;
                remaining = elapsed >= votingTimeout ? 0 : votingTimeout - elapsed;
            }
        }

        return (
            activeSampleIds,
            sampleData,
            labelSpace,
            remaining,
            _currentRound
        );
    }

    /**
     * @dev Compute batch progress with active samples count (for Project.sol)
     */
    function computeBatchProgress(
        uint256 round,
        string[] memory sampleIds,
        bool[] memory sampleActiveStates
    ) external pure returns (
        uint256 _round,
        uint256 totalSamples,
        uint256 activeSamplesCount,
        uint256 completedSamples,
        string[] memory _sampleIds,
        bool batchActive
    ) {
        require(sampleIds.length == sampleActiveStates.length, "Length mismatch");

        uint256 activeCount = 0;
        uint256 completedCount = 0;

        for (uint256 i = 0; i < sampleIds.length; i++) {
            if (sampleActiveStates[i]) {
                activeCount++;
            } else if (sampleIds.length > 0) {
                completedCount++;
            }
        }

        return (
            round,
            sampleIds.length,
            activeCount,
            completedCount,
            sampleIds,
            sampleIds.length > 0 && activeCount > 0
        );
    }

    function getCurrentBatchProgress() external view returns (
        uint256 round,
        bool isActive,
        uint256 totalSamples,
        uint256 completedSamples,
        string[] memory sampleIds
    ) {
        BatchInfo storage batch = batches[currentRound];
        return (
            currentRound,
            batch.isActive,
            batch.sampleIds.length,
            batch.completedCount,
            batch.sampleIds
        );
    }

    function wasConsensusAchieved(string memory sampleId) external view returns (bool) {
        if (!votingSessions[sampleId].isFinalized) {
            return false;
        }

        string memory finalLabel = votingSessions[sampleId].finalLabel;
        if (bytes(finalLabel).length == 0 || 
            keccak256(bytes(finalLabel)) == keccak256(bytes("NO_CONSENSUS")) ||
            keccak256(bytes(finalLabel)) == keccak256(bytes("NO_VOTES"))) {
            return false;
        }

        // Check if the final label achieved true consensus
        return _checkConsensus(sampleId, finalLabel);
    }

    function _aggregateVotes(string memory sampleId) internal view returns (string memory) {
        Vote[] memory voteList = votes[sampleId];
        if (voteList.length == 0) return "NO_VOTES";

        // Find label with highest weighted support for tie-breaking
        mapping(string => uint256) storage labelWeights = votingSessions[sampleId].labelWeights;

        string memory bestLabel = "";
        uint256 maxWeight = 0;

        // Find label with highest weighted support
        for (uint256 i = 0; i < voteList.length; i++) {
            if (voteList[i].support) {
                string memory label = voteList[i].label;
                uint256 weight = labelWeights[label];

                if (weight > maxWeight) {
                    maxWeight = weight;
                    bestLabel = label;
                }
            }
        }

        return bytes(bestLabel).length > 0 ? bestLabel : "NO_CONSENSUS";
    }

    function _notifyMainContract(string memory sampleId, string memory finalLabel) internal {
        // Call back to Project to store the final result
        try this.notifyMainContractExternal(sampleId, finalLabel) {
            // Success
            emit LabelStoredInProject(sampleId, finalLabel, block.timestamp);
        } catch {
            // Continue even if notification fails
        }
    }

    function notifyMainContractExternal(string memory sampleId, string memory finalLabel) external {
        require(msg.sender == address(this), "Internal call only");

        // Interface call to Project to store final label
        try IProject(project).receiveFinalLabelFromVoting(
            sampleId,
            finalLabel
        ) {
            // Success
        } catch {
            // Continue even if storage fails
        }

        // Notify Project about session ending
        try IProject(project).notifyVotingSessionEnded(sampleId, finalLabel) {
            // Success
        } catch {
            // Continue even if notification fails
        }
    }
}

contracts/Asset.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;


contract Asset {
    // State variables
    address public owner;
    string public name;
    string public ipfsHash;
    string public assetType; // "dataset", "model", "script", etc.
    uint256 public createdAt;
    uint256 public updatedAt;

    // Viewer system (for UI filtering only)
    mapping(address => bool) public viewers;
    address[] public viewerList;

    // Events
    event AssetCreated(address indexed owner, string name, string ipfsHash);
    event AssetUpdated(string newIpfsHash);
    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);
    event ViewerAdded(address indexed viewer);
    event ViewerRemoved(address indexed viewer);

    // Modifiers
    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can perform this action");
        _;
    }

    constructor(
        address _owner,
        string memory _name,
        string memory _assetType,
        string memory _ipfsHash,
        address[] memory _initialViewers
    ) {
        require(_owner != address(0), "Owner address cannot be zero");
        require(bytes(_name).length > 0, "Asset name cannot be empty");
        require(bytes(_ipfsHash).length > 0, "IPFS hash cannot be empty");

        owner = _owner;
        name = _name;
        assetType = _assetType;
        ipfsHash = _ipfsHash;
        createdAt = block.timestamp;
        updatedAt = block.timestamp;

        // Add initial viewers during construction (if any provided)
        for (uint256 i = 0; i < _initialViewers.length; i++) {
            address viewer = _initialViewers[i];
            if (viewer != address(0) && viewer != _owner && !viewers[viewer]) {
                viewers[viewer] = true;
                viewerList.push(viewer);
                emit ViewerAdded(viewer);
            }
        }

        emit AssetCreated(_owner, _name, _ipfsHash);
    }

    function getIpfsHash() external view returns (string memory) {
        return ipfsHash;
    }

    // Public function - no access control, anyone can view asset info
    function getAssetInfo() external view returns (
        address assetOwner,
        string memory assetName,
        string memory assetTypeValue,
        string memory assetIpfsHash,
        uint256 created,
        uint256 updated
    ) {
        return (
            owner,
            name,
            assetType,
            ipfsHash,
            createdAt,
            updatedAt
        );
    }

    // Viewer management functions (for UI filtering)
    function addViewer(address _viewer) external onlyOwner {
        require(_viewer != address(0), "Invalid viewer address");
        require(_viewer != owner, "Owner is automatically a viewer");
        require(!viewers[_viewer], "Already a viewer");

        viewers[_viewer] = true;
        viewerList.push(_viewer);
        emit ViewerAdded(_viewer);
    }

    function removeViewer(address _viewer) external onlyOwner {
        require(viewers[_viewer], "Not a viewer");

        viewers[_viewer] = false;

        // Remove from viewerList array
        for (uint256 i = 0; i < viewerList.length; i++) {
            if (viewerList[i] == _viewer) {
                viewerList[i] = viewerList[viewerList.length - 1];
                viewerList.pop();
                break;
            }
        }

        emit ViewerRemoved(_viewer);
    }

    function isViewer(address _address) external view returns (bool) {
        return _address == owner || viewers[_address];
    }

    function getViewers() external view returns (address[] memory) {
        return viewerList;
    }

    function getViewerCount() external view returns (uint256) {
        return viewerList.length;
    }

    function updateIpfsHash(string memory _newIpfsHash) external onlyOwner {
        require(bytes(_newIpfsHash).length > 0, "IPFS hash cannot be empty");

        ipfsHash = _newIpfsHash;
        updatedAt = block.timestamp;

        emit AssetUpdated(_newIpfsHash);
    }

    function updateMetadata(
        string memory _name
    ) external onlyOwner {
        if (bytes(_name).length > 0) {
            name = _name;
        }
        updatedAt = block.timestamp;
    }

    function transferOwnership(address _newOwner) external onlyOwner {
        require(_newOwner != address(0), "New owner address cannot be zero");
        require(_newOwner != owner, "New owner is the same as current owner");

        address previousOwner = owner;
        owner = _newOwner;

        emit OwnershipTransferred(previousOwner, _newOwner);
    }
}

